import React from "react";
import { Container } from './styles';

export default function SearchBar({ setSearchQuery }) {
    return (
        <Container>
            <input
                type="search"
                placeholder="Search for the Song"
                onChange={(e) => setSearchQuery(e.target.value)}
            />
        </Container>
    );
}
